at currencies, the correlation between average growth rate and volatility is moderate. |\n","|  | Spearman Rank Correlation (Volatility and Average Growth Rate - Fiat) | 0.287 | The Spearman rank correlation is lower, indicating a weaker relationship. |\n","|  | Pearson Correlation (Volatility and Average Growth Rate - Crypto) | 0.267 | For cryptocurrencies, the correlation is weak, suggesting limited support for this hypothesis in terms of Pearson correlation. |\n","|  | Spearman Rank Correlation (Volatility and Average Growth Rate - Crypto) | 0.548 | The Spearman rank correlation is moderate, showing a better relationship between volatility and average growth rate for cryptocurrencies. |\n","| Hypothesis 3: Cryptocurrencies with higher average percent changes have higher volatility. | Pearson Correlation (Volatility and Average Percent Change - Fiat) | 0.507 | The correlation between volatility and average percent change for fiat currencies is moderate. |\n","|  | Spearman Rank Correlation (Volatility and Average Percent Change - Fiat) | 0.320 | The Spearman rank correlation is weaker, suggesting a less strong relationship. |\n","|  | Pearson Correlation (Volatility and Average Percent Change - Crypto) | 0.940 | A very high Pearson correlation indicates a strong relationship between volatility and average percent change for cryptocurrencies. |\n","|  | Spearman Rank Correlation (Volatility and Average Percent Change - Crypto) | 0.919 | The Spearman rank correlation is also very high, supporting a strong positive relationship between volatility and average percent change for cryptocurrencies. |\n","| Hypothesis 4: The average percent change for cryptocurrencies is more extreme (both positive and negative) compared to fiat currencies. | Wilcoxon Rank-Sum Test | W = 72, p-value = 6.303e-10 | The very low p-value indicates a significant difference in the distribution of average percent changes between cryptocurrencies and fiat currencies. Cryptocurrencies have more extreme percent changes. |\n","| Hypothesis 5: Cryptocurrencies with higher average growth rates have higher average percent changes. | Pearson Correlation (Average Growth Rate and Average Percent Change - Fiat) | 0.902 | For fiat currencies, there is a very high correlation, indicating that higher average growth rates are strongly associated with higher average percent changes. |\n","|  | Spearman Rank Correlation (Average Growth Rate and Average Percent Change - Fiat) | 0.923 | The Spearman rank correlation is also very high, supporting a strong relationship. |\n","|  | Pearson Correlation (Average Growth Rate and Average Percent Change - Crypto) | 0.317 | For cryptocurrencies, the Pearson correlation is relatively weak, suggesting a weaker relationship. |\n","|  | Spearman Rank Correlation (Average Growth Rate and Average Percent Change - Crypto) | 0.624 | The Spearman rank correlation is moderate, indicating some positive relationship. |\n","\n","### Result of Hypothesis Testing:\n","\n","- Hypothesis 1: Supported by both the Pearson correlation and Welchâ€™s t-test. Cryptocurrencies have significantly higher volatility compared to fiat currencies.\n","\n","- Hypothesis 2: Mixed results. The Pearson correlation is weak, but the Spearman rank correlation shows a moderate positive relationship for cryptocurrencies.\n","\n","- Hypothesis 3: Strongly supported for cryptocurrencies. Both Pearson and Spearman correlations are high, indicating a strong positive relationship between volatility and average percent changes.\n","\n","- Hypothesis 4: Supported by the Wilcoxon rank-sum test, showing that cryptocurrencies have more extreme average percent changes compared to fiat currencies.\n","\n","- Hypothesis 5: Mixed results. High correlations in fiat currencies but weaker correlations in cryptocurrencies, indicating only partial support for this hypothesis.\n"]},{"cell_type":"markdown","id":"bed56a28","metadata":{"papermill":{"duration":0.011163,"end_time":"2024-07-26T09:56:24.963698","exception":false,"start_time":"2024-07-26T09:56:24.952535","status":"completed"},"tags":[]},"source":["# Overall Conclusion\n","\n","- Cryptocurrencies demonstrate higher volatility and more extreme average percent changes compared to fiat currencies, which is well-supported by the data. While correlations between average growth rates and volatility in cryptocurrencies are moderate, they are stronger when linked to average percent changes. Despite some mixed results regarding average growth rates and percent changes, the overall evidence supports the notion that cryptocurrencies are more volatile and exhibit more extreme value fluctuations than fiat currencies.\n","\n","- The analysis also highlights the dynamic and evolving nature of the cryptocurrency market, particularly in terms of regulatory frameworks and adoption. While cryptocurrencies may offer higher growth potential, they also come with higher risk and volatility. Both sectors (cryptocurrencies and fiat currencies) present unique characteristics and challenges, and ongoing adaptation in regulatory and security measures is crucial for managing these dynamics effectively."]},{"cell_type":"markdown","id":"82e31540","metadata":{"papermill":{"duration":0.011152,"end_time":"2024-07-26T09:56:24.985966","exception":false,"start_time":"2024-07-26T09:56:24.974814","status":"completed"},"tags":[]},"source":["# Addressing stakeholders' concerns\n","\n","- **Regulatory Compliance:** The evolving regulatory environment for cryptocurrencies suggests that adopting them could align with the vision of innovation but requires careful consideration of compliance challenges.\n","\n","- **Market Volatility:** Cryptocurrencies' higher volatility presents a significant risk, impacting stability. This risk must be weighed against the potential benefits of increased growth opportunities.\n","\n","- **Security Risks:** While cryptocurrencies may offer some security advantages over traditional finance, the frequency and nature of security incidents highlight the need for robust security measures.\n","\n","- **Economic Impact:** The potential for extreme value fluctuations in cryptocurrencies could affect financial performance and economic stability, necessitating a strategic approach to integration.\n","\n","\n","Integrating cryptocurrencies into FinTech Future Solutionsâ€™ operations **<u>aligns with the companyâ€™s vision</u>** of innovation but presents challenges related to volatility, regulatory compliance, and security. The study supports the notion that while cryptocurrencies offer potential growth and innovation, their **<u>adoption must be strategically managed</u>** to align with the companyâ€™s goals of inclusivity, security, and sustainability. Effective management of these dynamics will be crucial for integrating cryptocurrencies in a manner that supports the company's vision and addresses the stakeholders' concerns."]},{"cell_type":"markdown","id":"f842eb35","metadata":{"papermill":{"duration":0.01119,"end_time":"2024-07-26T09:56:25.008331","exception":false,"start_time":"2024-07-26T09:56:24.997141","status":"completed"},"tags":[]},"source":["# Decision - Making Guide(Sample)\n","\n","### Scoring Guide\n","| **Score** | **Interpretation** | **Description** |\n","|-----------|--------------------|-----------------|\n","| 1         | Strongly Oppose: The factor presents significant risks or challenges that outweigh potential benefits. | Indicates that the factor is highly unfavorable, with risks or challenges that strongly outweigh any potential benefits. |\n","| 2         | Oppose: The factor has considerable concerns that may outweigh the benefits. | Indicates that the factor has notable concerns or drawbacks that may overshadow the benefits. |\n","| 3         | Neutral: The factor has both pros and cons that balance each other. | Indicates that the factor presents a balanced view, with neither significant benefits nor drawbacks. |\n","| 4         | Support: The factor presents more benefits than risks, suggesting a positive impact. | Indicates that the factor is favorable, with benefits outweighing the risks or challenges. |\n","| 5         | Strongly Support: The factor strongly favors adoption with significant benefits and minimal risks. | Indicates that the factor is highly favorable, with significant benefits and minimal risks. |\n"]},{"cell_type":"code","execution_count":9,"id":"f3a7a6c7","metadata":{"execution":{"iopub.execute_input":"2024-07-26T09:56:25.034699Z","iopub.status.busy":"2024-07-26T09:56:25.032998Z","iopub.status.idle":"2024-07-26T09:56:25.350086Z","shell.execute_reply":"2024-07-26T09:56:25.347304Z"},"papermill":{"duration":0.339365,"end_time":"2024-07-26T09:56:25.358863","exception":false,"start_time":"2024-07-26T09:56:25.019498","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<!doctype html>\n","<html>\n","\t<head>\n","\t\t<meta charset=\"utf-8\">\n","\t\t<link href=\"data:text/css;charset-utf-8;base64,\" rel=\"stylesheet\" />\n","<script title=\"htmlwidgets\" src=\"data:application/javascript;base64,\"></script>\n","<link href=\"data:text/css;charset-utf-8;base64,\" rel=\"stylesheet\" />\n","<script title=\"datatables-binding\" src=\"data:application/javascript;base64,\"></script>\n","<script title=\"jquery\" src=\"data:application/javascript;base64,\"></script>\n","<script title=\"dt-core\" src=\"data:application/javascript;base64,\"></script>\n","<link href=\"data:text/css;charset-utf-8;base64,\" rel=\"stylesheet\" />\n","<link href=\"data:text/css;charset-utf-8;base64,\" rel=\"stylesheet\" />\n","<script title=\"crosstalk\" src=\"data:application/javascript;base64,\"></script>\n","<link href=\"data:text/css;charset-utf-8;base64,\" rel=\"stylesheet\" />\n","\t</head>\n","\t<body>\n","\t\t<div class=\"datatables html-widget html-fill-item\" id=\"htmlwidget-19dad3a2a1b6baba717d\" style=\"width:100%;height:auto;\"></div>\n","<script type=\"application/json\" data-for=\"htmlwidget-19dad3a2a1b6baba717d\">{\"x\":{\"filter\":\"none\",\"vertical\":false,\"caption\":\"<caption>Decision-Making Ranking Guide with Interpretations<\\/caption>\",\"data\":[[\"1\",\"2\",\"3\",\"4\",\"5\",\"6\"],[\"Volatility\",\"Regulatory Environment\",\"Security\",\"Innovation and Competitive Advantage\",\"Market Adoption and Growth Potential\",\"Economic Impact\"],[\"The degree of volatility associated with cryptocurrencies. Lower volatility is preferred for stability.\",\"The clarity, stability, and alignment of regulatory frameworks concerning cryptocurrencies.\",\"The current security measures and risks associated with cryptocurrencies versus traditional finance.\",\"The potential for cryptocurrencies to drive innovation and provide a competitive edge in the financial sector.\",\"The current adoption rates, market growth potential, and alignment with future trends in cryptocurrency use.\",\"The potential influence of adopting cryptocurrencies on the company's financial performance and stability.\"],[\" \",\" \",\" \",\" \",\" \",\" \"],[\"Cryptocurrencies are more volatile compared to fiat currencies, which may introduce financial risk. Consider whether the company can manage this risk effectively.\",\"A stable and clear regulatory environment supports smoother integration. Given that regulations are evolving, assess whether upcoming regulations align with the company's vision.\",\"Cryptocurrencies face fewer attacks than traditional finance, but they still require robust security measures. Determine if the company can address potential security challenges effectively.\",\"Adoption could enhance innovation and align with the company's vision of being at the forefront of technology. Evaluate if this aligns with the companyâ€™s strategic goals.\",\"High adoption rates and growth potential suggest a favorable environment for integration. Assess whether the potential benefits outweigh the risks and if the company can leverage these trends effectively.\",\"Consider the impact on financial stability and performance. Evaluate if the integration of cryptocurrencies can enhance or disrupt economic stability and performance.\"],[\"No score provided\",\"No score provided\",\"No score provided\",\"No score provided\",\"No score provided\",\"No score provided\"]],\"container\":\"<table class=\\\"display\\\">\\n  <thead>\\n    <tr>\\n      <th> <\\/th>\\n      <th>Factor<\\/th>\\n      <th>Criteria<\\/th>\\n      <th>Score<\\/th>\\n      <th>Justification<\\/th>\\n      <th>Interpretation<\\/th>\\n    <\\/tr>\\n  <\\/thead>\\n<\\/table>\",\"options\":{\"pageLength\":10,\"autoWidth\":true,\"columnDefs\":[{\"orderable\":false,\"targets\":0},{\"name\":\" \",\"targets\":0},{\"name\":\"Factor\",\"targets\":1},{\"name\":\"Criteria\",\"targets\":2},{\"name\":\"Score\",\"targets\":3},{\"name\":\"Justification\",\"targets\":4},{\"name\":\"Interpretation\",\"targets\":5}],\"order\":[],\"orderClasses\":false}},\"evals\":[],\"jsHooks\":[]}</script>\n","\t</body>\n","</html>\n"],"text/plain":["HTML widgets cannot be represented in plain text (need html)"]},"metadata":{"text/html":{"isolated":true}},"output_type":"display_data"}],"source":["# Load the DT library\n","library(DT)\n","\n","# Create a data frame \n","decision_guide <- data.frame(\n","  Factor = c(\n","    \"Volatility\", \n","    \"Regulatory Environment\", \n","    \"Security\", \n","    \"Innovation and Competitive Advantage\", \n","    \"Market Adoption and Growth Potential\", \n","    \"Economic Impact\"\n","  ),\n","  Criteria = c(\n","    \"The degree of volatility associated with cryptocurrencies. Lower volatility is preferred for stability.\",\n","    \"The clarity, stability, and alignment of regulatory frameworks concerning cryptocurrencies.\",\n","    \"The current security measures and risks associated with cryptocurrencies versus traditional finance.\",\n","    \"The potential for cryptocurrencies to drive innovation and provide a competitive edge in the financial sector.\",\n","    \"The current adoption rates, market growth potential, and alignment with future trends in cryptocurrency use.\",\n","    \"The potential influence of adopting cryptocurrencies on the company's financial performance and stability.\"\n","  ),\n","  Score = c(\n","    \" \",  # INPUT SCORES HERE!!!\n","    \" \",\n","    \" \",\n","    \" \",\n","    \" \",\n","    \" \"\n","  ),\n","  Justification = c(\n","    \"Cryptocurrencies are more volatile compared to fiat currencies, which may introduce financial risk. Consider whether the company can manage this risk effectively.\",\n","    \"A stable and clear regulatory environment supports smoother integration. Given that regulations are evolving, assess whether upcoming regulations align with the company's vision.\",\n","    \"Cryptocurrencies face fewer attacks than traditional finance, but they still require robust security measures. Determine if the company can address potential security challenges effectively.\",\n","    \"Adoption could enhance innovation and align with the company's vision of being at the forefront of technology. Evaluate if this aligns with the companyâ€™s strategic goals.\",\n","    \"High adoption rates and growth potential suggest a favorable environment for integration. Assess whether the potential benefits outweigh the risks and if the company can leverage these trends effectively.\",\n","    \"Consider the impact on financial stability and performance. Evaluate if the integration of cryptocurrencies can enhance or disrupt economic stability and performance.\"\n","  ),\n","  Interpretation = c(\n","    \"\",  # Interpretations based on scores will be generated\n","    \"\",\n","    \"\",\n","    \"\",\n","    \"\",\n","    \"\"\n","  ),\n","  stringsAsFactors = FALSE\n",")\n","\n","# Function to determine interpretation based on score\n","get_interpretation <- function(score) {\n","  switch(\n","    as.character(score),\n","    \"1\" = \"Strongly oppose: The factor presents significant risks or challenges that outweigh potential benefits.\",\n","    \"2\" = \"Oppose: The factor has considerable concerns that may outweigh the benefits.\",\n","    \"3\" = \"Neutral: The factor has both pros and cons that balance each other.\",\n","    \"4\" = \"Support: The factor presents more benefits than risks, suggesting a positive impact.\",\n","    \"5\" = \"Strongly support: The factor strongly favors adoption with significant benefits and minimal risks.\",\n","    \"No score provided\"\n","  )\n","}\n","\n","# Populate Interpretation based on Scores\n","decision_guide$Interpretation <- sapply(decision_guide$Score, get_interpretation)\n","\n","# Display the table using DT\n","datatable(\n","  decision_guide,\n","  options = list(pageLength = 10, autoWidth = TRUE),\n","  caption = 'Decision-Making Ranking Guide with Interpretations'\n",")\n"]},{"cell_type":"markdown","id":"f07da478","metadata":{"papermill":{"duration":0.020096,"end_time":"2024-07-26T09:56:25.399635","exception":false,"start_time":"2024-07-26T09:56:25.379539","status":"completed"},"tags":[]},"source":["# Notes\n","\n","|                 |                                                                                                                                                                                                                        |\n","|-----------------------------|-----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------|\n","| **Data Limitations**        | - The historical price data for both fiat and cryptocurrencies is subject to market volatility and may not fully capture sudden or unprecedented market events.<br>- Certain cryptocurrencies analyzed have shorter historical records, which may limit the robustness of long-term trend analysis.<br>- Assumptions were made in the data cleaning process to standardize date formats and remove outliers, which could influence the results. |\n","| **Methodological Assumptions** | - Linear regression models were used to analyze currency trends. These models assume a linear relationship, which might not capture more complex patterns.<br>- Correlation analyses assume normal distribution of data, which may not hold true for all variables. |\n","| **Data Sources**            | - Fiat historical prices were sourced from Investing.com, which provides comprehensive financial data but may have reporting delays.<br>- Cryptocurrency prices were obtained from CoinMarketCap, a reputable source for market data but subject to rapid changes in the volatile crypto market. |\n","| **Analytical Challenges**   | - Integrating data from multiple sources required careful alignment of time periods and currency denominations.<br>- Ensuring consistency in data formatting across different datasets posed a significant challenge. |\n","| **Future Research Directions** | - Further studies could explore the impact of macroeconomic indicators on currency stability.<br>- Additional research could investigate the role of geopolitical events in shaping currency trends. |\n","| **Regulatory Landscape**    | - The evolving regulatory environment for cryptocurrencies, particularly with upcoming regulations in 2024, could significantly impact market dynamics.<br>- Stablecoin regulations influenced by the EUâ€™s MiCA and other regulatory frameworks are crucial areas to monitor. |\n","| **Technological Impact**    | - Advancements in blockchain technology and cybersecurity measures will play a critical role in the adoption and stability of cryptocurrencies.<br>- Future analyses could benefit from incorporating data on technological innovations and their adoption rates. |\n","| **Implications for Stakeholders** | - Investors should consider the high volatility of cryptocurrencies and the regulatory uncertainties.<br>- Financial institutions might explore the integration of stablecoins to leverage their price stability and regulatory acceptance. |\n","| **Ethical Considerations**  | - Ensuring data privacy and security is paramount, particularly when handling financial information.<br>- Ethical use of data, including transparency in methodology and sourcing, is crucial for maintaining trust in financial analysis. |\n","\n","# Author's Remarks\n","\n","This Case Study is my very first and created solely for the purpose of trying my hands on actual Analysis and reporting, using the tools and applying my knowledge from the courses I took in Data Analytics. This explains the Fictional Scenario I crafted. Part of this Case Study is for the completion of my Google Data Analytics Capstone in Coursera.\n","\n","A significant portion of this case study has been done, refined and suggested with the aid of AI Tools (ChatGPT, Gemini).I believe that AI tools exist to be leveraged in tasks and I am somebody who does not wish to fight technology(AI) instead make intelligent use of it. The whole journey provided me with great Experience and Knowledge especially when times that AI suggests analysis that is not in the scope of my current understanding and revealed gaps in my knowledge especially in the statistics, mathematics and programming. It prompted me to take additional courses and seek other sources of information in order for me to actually understand what I am doing. It also provided me with future avenues to explore. Hence for that matter I am very grateful for this wonderful technology. I have also developed a PERSONAL AI DEPENDENCY rating based on my AI Usage in order ro track my personal progress. You can view it [HERE]()\n","\n","I also want to express my deepest gratitude and appreciation for the entities that have allowed me to complete this Case Study. Kaggle, Tableau Public, Wikipedia, Investing.com, CoinmarketCap, Carnegie Endowment and Atlantic Council.org. The datasets I compiled from the raw files I downloaded from the sources have been uploaded here on Kaggle but I set them to private for ethical reasons.\n","\n","Lastly, if ever this report reaches the eye of any viewer, feel free to make comments, mention any innacuracies or mistakes and express opinions. I will be very grateful for any feedback."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":5419121,"sourceId":8996649,"sourceType":"datasetVersion"},{"datasetId":5448021,"sourceId":9037630,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":9.574808,"end_time":"2024-07-26T09:56:25.542463","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-07-26T09:56:15.967655","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}